import { MenuBook } from '@mui/icons-material';
import { AppBar, Box, Toolbar, IconButton } from '@mui/material';
// sx={{}}
const Header = () => {
  return (
    <>
      <AppBar sx={{ position: 'sticky' }}>
        <Toolbar
          sx={{
            display: 'flex',
            justifyContent: 'space-between',
            width: '100%',
          }}>
          <Box sx={{ flex: 1 }}>Logo</Box>
          <Box sx={{ flex: 1 }}>
            <ul sx={{ display: 'flex' }}>
              <li>trending</li>
              <li>movies</li>
              <li>series</li>
              <li>search</li>
            </ul>
          </Box>

          <Box sx={{ flex: 1 }}>
            <IconButton>
              <MenuBook />
            </IconButton>
          </Box>
        </Toolbar>
      </AppBar>
    </>
  );
};

export default Header;
